import axios from "axios";
const API_URL = "https://api.enviosuramerica.com/services-web/tracking-guia";

export const trackingGuide = async (guia: string) => {
  try {
    const response = await axios.post(
      API_URL,
      {},
      {
        // withCredentials: true,
        headers: {
          "Content-Type": "application/json",
        },
      }
    );
    if (response.status === 200) {
      console.log(response.data.message);
      return response.data;
    }
  } catch (err) {
    console.error("Error al recibir la solicitud", err);
    throw err;
  }
};
